Descripcion
Basada en los relatos de semi-autobiográficos del escritor ruso Mijail Bulgakov, la miniserie se centra en un médico después de la Primera Guerra Mundial, inspirado por el propio  Bulgakov, trabajando como médico en una pequeña aldea rusa. El protagonista tendrá dificultades para hacer frente tanto a sus pacientes como a sus propios demonios internos, y su yo joven contemporáneo frecuentemente conversa con su yo mayor.
